            margin-top: -8px;
            margin-left: -8px;
        }

        .context-menu {
            display: none;
            position: absolute;
            z-index: 10;
        }

        .context-menu--active {
            display: block;
        }

        .context-menu ul {
            background-color: #97f6a18c;
            border: 1px solid #000000;
            list-style: none;
            padding-inline-start: 0px;
        }

        .context-menu ul li {
            padding: 3px;
        }

        .context-menu ul li:hover {
            background-color: #97f6a1b0;
        }

        .context-menu ul li span {
            cursor: pointer;
        }

<body>
<canvas width="2430" height="1558" id="map" class="map"></canvas>
<nav id="contextMenu" class="context-menu">
    <ul class="context-menu__items">
        <li class="context-menu__item">
            <span class="context-menu__link" onclick="painter.start(1);menuHandler.close();">
                <i class="fa fa-eye"></i> Switch to Km
            </span>
        </li>
        <li class="context-menu__item">
            <span class="context-menu__link" onclick="painter.start(2);menuHandler.close();">
                <i class="fa fa-edit"></i> Switch to Miles
            </span>
        </li>
        <li class="context-menu__item">
            <span class="context-menu__link" onclick="painter.changeEssence();menuHandler.close();">
                <i class="fa fa-times"></i> Set Essence
            </span>
        </li>
    </ul>
</nav>
<script type="text/javascript">
    let map = document.getElementById('map');
    const painter = function (map) {
        const context = map.getContext('2d'),
            offsetLeft = 2430 - map.offsetWidth,
            offsetTop = 1558 - map.offsetHeight,
            scaleM = 6.8,//Miles
            scaleK = 10.9435392,//Km
            //Inconveniences are just a small variance for small detours, prolonged stops and occasional maintenance
            convenience = {'Ideal': 1, 'Difficult': 0.5}
        ;
        let scale, scaleName,
            speeds,
            speedsM = [
                //format is [mph, hoursPerDay, name, multipliesByEssence]
                [4, 8, 'Horse (pack)', false],
                [10, 10, 'Horse (fast relays)', false],
                [30, 10, 'Agata', false],
                [100, 10, 'Stormwind Rider'],
                [6, 24, 'Cirrus Skiff', true],
                [6, 24, 'Merchant Ship', false]
            ],
            speedsK = [
                //format is [km/h, hoursPerDay, name]
                [6.437376, 8, 'Horse (pack)', false],
                [16.09344, 10, 'Horse (fast relays)', false],
                [48.28032, 10, 'Agata', false],
                [160.9344, 10, 'Stormwind Rider', false],
                [9.656064, 24, 'Cirrus Skiff', true],
                [9.656064, 24, 'Merchant Ship', false],
            ],
            essence = 1,
            start = null,
            end = null
        ;
        context.font = 'Bold 32px Arial';

        function drawCircle(point, start) {
            context.lineWidth = 1;
            context.beginPath();
            context.arc(point.X, point.Y, 8, 0, 2 * Math.PI, false);
            if (start) {
                context.fillStyle = '#008800';
            } else {
                context.fillStyle = '#C92B28';
            }
            context.fill();
            context.strokeStyle = '#003300';
            context.stroke();
        }

        function drawText(text, x, y, lineHeight) {
            context.strokeStyle = '#cf96f2';
            context.fillStyle = '#000000';
            let cars = text.split("\n");
            for (let ii = 0; ii < cars.length; ii++) {
                let line = cars[ii];
                context.lineWidth = 2;
                context.fillText(line, x, y);
                context.strokeText(line, x, y);
                y += lineHeight;
            }
        }

        function clear() {
            context.clearRect(0, 0, 2430, 1558);
            start = null;
            end = null;
        }

        function chooseScale(type) {
            if (type === 1) {
                scale = scaleK;
                speeds = speedsK;
                scaleName = "kilometers";
            } else {
                scale = scaleM;
                speeds = speedsM;
                scaleName = "miles"
            }
        }

        function chooseEssence() {
            let e = prompt("Choose an Essence score (1 to 10)");
            if (e === null) {
                return;
            }
            e = parseInt(e);
            if (isNaN(e) || e > 10 || e < 1) {
                chooseEssence();
                return;
            }
            essence = e;
        }

        function bindMap(scaleType) {
            clear();
            chooseScale(scaleType);
            map.onclick = function (e) {
                let pos = {'X': e.pageX - offsetLeft, 'Y': e.pageY - offsetTop};
                if (start == null) {
                    start = pos;
                    drawCircle(start, true);
                } else if (end == null) {
                    end = pos;
                    context.lineWidth = 1;
                    context.beginPath();
                    context.moveTo(start.X, start.Y);
                    context.lineTo(end.X, end.Y);
                    context.strokeStyle = '#000000';
                    context.stroke();
                    drawCircle(end, false);
                    drawCircle(start, true);
                    let dist = Math.floor(Math.sqrt(Math.pow((end.X - start.X), 2) + Math.pow((end.Y - start.Y), 2)) * scale),
                        text = dist + " " + scaleName
                    ;

                    speeds.forEach(function (vehicle) {
                        let dur = [],
                            speed = vehicle[0],
                            name = vehicle[2],
                            journeyLength = vehicle[1];
                        //Essence factors
                        if (vehicle[3]) {
                            speed = vehicle[0] * essence;
                            name += " (Essence " + essence + ")";
                        }
                        for (let type in convenience) {
                            let days = Math.floor((dist / (speed * convenience[type] * journeyLength)) * 10) / 10;
                            dur.push(days.toString());
                        }
                        text += "\n" + name + ": " + dur.join(" / ") + ' days';
                    });

                    let offsetX = 0,
                        offsetY = 0;
                    if (end.X > 2200) {
                        offsetX = 450;
                    }
                    if (end.Y > 1400) {
                        offsetY = 200;
                    }
                    drawText(text, end.X + 24 - offsetX, end.Y + 10 - offsetY, 32);
                } else {
                    start = null;
                    end = null;
                    clear();
                }
            };
        }

        return {
            start: bindMap,
            changeEssence: chooseEssence,
            clear: clear
        };
    }(map);

    painter.start(1);

    const menuHandler = function (taskItemClassName) {
        let menu = document.getElementById("contextMenu"),
            menuState = 0,
            activeClassName = "context-menu--active",
            menuPosition,
            menuPositionX,
            menuPositionY
        ;

        function clickInsideElement(e, className) {
            let el = e.parentElement || e.target;

            if (el.classList.contains(className)) {
                return el;
            } else {
                while (el = el.parentNode) {
                    if (el.classList && el.classList.contains(className)) {
                        return el;
                    }
                }
            }

            return false;
        }

        function getPosition(e) {
            let posx = 0,
                posy = 0;

            if (e.pageX || e.pageY) {
                posx = e.pageX;
                posy = e.pageY;
            } else if (e.clientX || e.clientY) {
                posx = e.clientX + document.body.scrollLeft +
                    document.documentElement.scrollLeft;
                posy = e.clientY + document.body.scrollTop +
                    document.documentElement.scrollTop;
            }
            return {
                x: posx,
                y: posy
            }
        }

        function positionMenu(e) {
            menuPosition = getPosition(e);
            menuPositionX = menuPosition.x + "px";
            menuPositionY = menuPosition.y + "px";

            menu.style.left = menuPositionX;
            menu.style.top = menuPositionY;
        }

        function init() {
            contextListener();
            clickListener();
        }

        function contextListener() {
            document.addEventListener("contextmenu", function (e) {
                if (clickInsideElement(e, taskItemClassName)) {
                    e.preventDefault();
                    openMenu();
                    positionMenu(e);
                } else {
                    closeMenu();
                }
            });
        }

        function clickListener() {
            document.addEventListener("click", function (e) {
                if (!clickInsideElement(e, 'context-menu')) {
                    closeMenu();
                }
            });
        }

        function openMenu() {
            if (menuState !== 1) {
                menuState = 1;
                menu.classList.add(activeClassName);
            }
        }

        function closeMenu() {
            if (menuState !== 0) {
                menuState = 0;
                menu.classList.remove(activeClassName);
            }
        }

        /**
         * Run the app.
         */
        init();

        return {
            close: closeMenu
        }
    }('map');
</script>
